import { Container, Form, Row } from 'reactstrap';
import './App.css';
import Category from './Category.js';
import Navi from './Navi.js'
import Product from './Product.js';

function App() {
  return (
    <div>
      <Container>
        <Row>
         <Navi/>
        </Row>
        <Row>
        <Category></Category>
        <Product></Product>
        </Row>
      </Container>
    </div>
  );
}

export default App;
